import React from 'react';
import '../../estilos/componentes/layout/footer.css'

const Footer = (props) => {
    return (
        <div>
            <footer>
                <section className="holder">
                    <div>
                        <a href="" className="btn-social btnFooterLi" target="_blank"><i className="fa-brands fa-linkedin-in"></i></a>
                        <a href="" className="btn-social btnFooterIg" target="_blank"><i className="fa-brands fa-instagram"></i></a>
                        <a href="" className="btn-social btnFooterGh" target="_blank"><i className="fa-brands fa-github-alt" aria-hidden="true"></i></a>
                    </div>
                </section>
            </footer>
        </div>
    );
}

export default Footer;
